import React from 'react';
import RankedPoolsTable from './RankedPoolsTable';
import Pusher from 'pusher-js';

const socket = new Pusher('7885860875bb513c3e34', {
    cluster: 'eu',
    encrypted: true
});

export default class ConnectedRankedPoolsTable extends React.Component {
    state = {
        ranked_pools_table: []
    };
    componentDidMount() {
        const channel = socket.subscribe('ranked_pools_table');
        channel.bind('ranked_pools_table', (data) => {
            this.setState(data);
        });

        // change this url:

        fetch('HTTP://localhost:8080/ranked_pools_table')
            .then((response) => response.json())
            .then((response) => this.setState(response));
    }
    render() {
        return <RankedPoolsTable ranked_pools_table={this.state.ranked_pools_table} />;
    }
}
